<?phpnamespace Nemundo\WebLog\Data\UrlLog;class UrlLogPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var UrlLogModel*/public $model;public function __construct() {parent::__construct();$this->model = new UrlLogModel();}/*** @return UrlLogRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new UrlLogRow($dataRow, $this->model);$list[] = $row;}return $list;}}